import React from 'react';
import { BrowserRouter as Router, Routes, Route, useParams } from 'react-router-dom';
import WelcomeScreen from './WelcomeScreen';
import PatientDashboard from './PatientDashboard';
import PhysicianDashboard from './PhysicianDashboard';
import PatientSelector from './PatientSelector';
import ErrorBoundary from './components/ErrorBoundary';
import './App.css';

// Simple patient list generation
const PATIENT_COUNT = 100;
const PATIENTS = Array.from({ length: PATIENT_COUNT }, (_, i) => 
  `Patient_${(i+1).toString().padStart(3, '0')}`
);

// Simple wrapper component for patient dashboard
function PatientDashboardWrapper() {
  const { patientId } = useParams();
  return <PatientDashboard patientId={patientId} />;
}

// Wrapper for physician dashboard
function PhysicianDashboardWrapper() {
  return <PhysicianDashboard patients={PATIENTS} />;
}

function App() {
  return (
    <ErrorBoundary>
      <Router>
        <Routes>
          <Route path="/" element={<WelcomeScreen />} />
          <Route path="/patient" element={<PatientSelector patients={PATIENTS} />} />
          <Route path="/patient/:patientId" element={<PatientDashboardWrapper />} />
          <Route path="/physician" element={<PhysicianDashboardWrapper />} />
        </Routes>
      </Router>
    </ErrorBoundary>
  );
}

export default App;
